import json
from typing import Union
import jinja2
from branca.element import Element
from folium.utilities import JsCode
from folium.utilities import TypeJsonValue
from folium.utilities import camelize


def _to_escaped_json(obj: TypeJsonValue) -> str:
    return json.dumps(obj).replace('<', '\\u003c').replace('>', '\\u003e'
        ).replace('&', '\\u0026').replace("'", '\\u0027')


def tojavascript(obj: Union[str, JsCode, dict, list, Element]) -> str:
    if isinstance(obj, str):
        return _to_escaped_json(obj)
    elif isinstance(obj, JsCode):
        return obj.code  # Assuming JsCode has a 'code' attribute that contains the JavaScript code
    elif isinstance(obj, dict):
        return _to_escaped_json(obj)
    elif isinstance(obj, list):
        return _to_escaped_json(obj)
    elif isinstance(obj, Element):
        return obj.render()  # Assuming Element has a 'render' method that returns the HTML representation
    else:
        raise TypeError("Unsupported type for tojavascript: {}".format(type(obj)))

